import {Box,HStack,Input,} from "@chakra-ui/react";
import React, { useEffect, useState} from "react";
import axios from "axios";

import "./App.css"


function App(){

  
  const url = "http://localhost:8005/questions";
  
  const [posts, setPosts] = useState('')
   console.log(posts)

    function getUser(cpf) {
      axios.get(`${url}?cpf=${cpf}`) // Append cpf to the URL
        .then((response) => {
          setPosts(response.data);
        })
        .catch((error) => console.log(error));
    }

    useEffect(() => {
      const handleCpfChange = (event) => {
        const cpf = event.target.value;
        getUser(cpf); 
      };
    
 
      const inputElement = document.getElementById("cpfInput");
      inputElement.addEventListener("change", handleCpfChange);
    
     
      return () => {
        inputElement.removeEventListener("change", handleCpfChange);
      };
    }, []);

  

  return(
    <div className="App" >  
    <div  className="Colum"> 
      <div className="cont">
          <center><h2  >Selecionar Pergunta</h2></center>
            <HStack spacing="8">
              <Box w="100%" ml="5%" mt="5%">
              
                <Input
                  className="wrap-input"
                  id="cpfInput"
                  onChange={(e) => (e.target.value)}
                />                
                {posts && (
                  <div key={posts._id}>
                
                  </div>
                )} 
              </Box>
            
            </HStack>
      </div><br></br><br></br>
          <div className="perguntas">
            {posts.length === 0 ? (
              <p>Carregando...</p>
            ) : (
              posts.map((post) => (
                <div className="perguntas" key={post._id}>
                <p>{post.infoPaciente}</p>
                <input 
                  type="checkbox"
                  id={post._id} 
                  value={post._id}
                 
                  
                />
              </div>
              ))
            )}
          </div>
         
          </div>
    </div>
  )
}

export default App
